Wonderful to catch up in person with new @AusSpaceAgency head Enrico Palermo to debrief after his first few weeks in the role. 

Enrico and I are determined to continue to grow the space sector and to reach our goal to create an extra 20,000 jobs by 2030. 

@HeadSpaceAu https://t.co/Qc0UAa4AF7

Did you know Aussie businesses like fabrication company Austec are part of our growing space industry? 

Through their partnership with Electro Optic Systems, their observation technologies are used for space tracking infrastructure, including telescopes.

@AusSpaceAgency https://t.co/2J603MufG4

As the daughter of a Veteran I'm very proud of the Morrison Govt’s commitment to our returned servicemen and women.

@DVAAus is distributing Veteran Cards, the Oath &amp; lapel pins to Veterans and I encourage businesses to get involved.

